        lastBuild = ((Job) item).getLastBuild();
    }

if ( !step.getWait() || (item instanceof Job) || (item instanceof Queue.Task)) {
    Node node = getContext().get(Node.class);
    if (node == null) {
        node = Jenkins.getActiveInstance();
    }

if ( !step.getWait() || (item instanceof ParameterizedJobMixIn.ParameterizedJob) || (item instanceof Queue.Task)) {
    EnvVars env = getContext().get(EnvVars.class);
    if (env != null) {
        job = env.expand(job);
    }

